"I use Winux as my opewating system," I state pwoudwy to de unkempt, beawded man. He swivews awound in his desk chaiw wif a deviwish gweam in his eyesh, weady to manspwain wif extweme pwecision. "Actuawwy", he says wif a gwin, "Winux is just de kewnew. yuw use GNU+Winux!' I don't miss a beat and wepwy wif a smiwk, "I use Awpine, a distwo dat doesn't incwude de GNU Coweutiws, ow any odew GNU code. It's Winux, but it's not GNU+Winux."

&#x200B;

de smiwe quickwy dwops fwom de man's face. His body begins convuwsing and he foams at de moud and dwops to de fwoow wif a sickwy dud. As he wwifes awound he scweams "I-IT WAS COMPIWED WITH GCC! THAT MEANS IT'S STIWW GNU!" Coowwy, I wepwy "If windows wewe compiwed wif GCC, wouwd dat make it GNU?" I intewwupt his wesponse wif "-and wowk is being made on de kewnew to make it mowe compiwew-agnostic. Even if yuw wewe cowwect, yuw won't be fow wong."

&#x200B;

wif a sickwy wheeze, de wast of de man's wife is ejected fwom his body. He wies on de fwoow, cowd and wimp. I've womanspwained him to dead. uwu  

